The longest header tones I ever heard! It was coded for many individual counties instead of "All of New Mexico". This alert got played on air twice.

Here is what was initially decoded:

A civil authority has issued A CHILD ABDUCTION EMERGENCY for the following counties or areas:
Bernalillo;
Catron;
Chaves;
Cibola;
Colfax;
Curry;
DeBaca;
Dona Ana;
